use chrono::{DateTime, Local};
use reqwest::Url;
use serde::Deserialize;

use crate::prelude::*;

#[derive(Deserialize)]
pub struct SearchResponse {
    pub listings: Vec<SearchListing>,
}

#[derive(Deserialize)]
pub struct SearchListing {
    #[serde(rename = "itemId")]
    pub item_id: String,

    pub title: String,

    pub description: String,

    #[serde(default, rename = "pictures")]
    pub pictures: Vec<Picture>,

    #[serde(rename = "priceInfo")]
    pub price: PriceInfo,

    #[serde(rename = "priorityProduct")]
    pub priority_product: PriorityProduct,

    #[serde(rename = "vipUrl")]
    pub url: String,
}

impl SearchListing {
    pub fn image_urls(&self) -> impl Iterator<Item = &str> {
        self.pictures.iter().filter_map(|picture| {
            picture
                .extra_large_url
                .as_deref()
                .or(picture.large_url.as_deref())
                .or(picture.medium_url.as_deref())
        })
    }
}

#[derive(Deserialize)]
pub struct PriceInfo {
    #[serde(rename = "priceCents")]
    pub cents: i32,

    #[serde(rename = "priceType")]
    pub type_: PriceType,
}

#[derive(Deserialize, Debug)]
pub enum PriceType {
    /// Fixed price, bidding are not allowed.
    #[serde(rename = "FIXED")]
    Fixed,

    #[serde(rename = "ON_REQUEST")]
    OnRequest,

    /// Price, bids are allowed.
    #[serde(rename = "MIN_BID")]
    MinBid,

    #[serde(rename = "SEE_DESCRIPTION")]
    SeeDescription,

    #[serde(rename = "NOTK")]
    ToBeAgreed,

    #[serde(rename = "RESERVED")]
    Reserved,

    /// No asking price, only bidding.
    #[serde(rename = "FAST_BID")]
    FastBid,

    #[serde(rename = "FREE")]
    Free,

    #[serde(rename = "EXCHANGE")]
    Exchange,
}

#[derive(Deserialize, Debug)]
pub struct Picture {
    #[serde(rename = "extraExtraLargeUrl", default)]
    pub extra_large_url: Option<String>,

    #[serde(rename = "largeUrl", default)]
    pub large_url: Option<String>,

    #[serde(rename = "mediumUrl", default)]
    pub medium_url: Option<String>,
}

#[derive(Deserialize)]
pub enum PriorityProduct {
    #[serde(rename = "NONE")]
    None,

    #[serde(rename = "DAGTOPPER")]
    DayTopper,
}

#[must_use]
pub struct Marktplaats(pub reqwest::Client);

impl Marktplaats {
    /// Search Marktplaats.
    pub async fn search(&self, query: &str, limit: &str) -> Result<SearchResponse> {
        info!("Searching `{query}`…");
        let url = Url::parse_with_params(
            "https://www.marktplaats.nl/lrp/api/search?offset=0&sortBy=SORT_INDEX&sortOrder=DECREASING",
            &[("query", query), ("limit", limit)],
        )?;
        self.0
            .get(url)
            .send()
            .await?
            .error_for_status()?
            .json()
            .await
            .with_context(|| format!("failed to search `{query}`"))
    }
}

